import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the price filter section using a unique text selector
    await page.waitForSelector('text=Price Range', { timeout: 5000 });

    // Use label text to locate the min and max price inputs (input[placeholder="Min"], input[placeholder="Max"])
    const minInput = await page.waitForSelector('input[placeholder="Min"]', { timeout: 5000 });
    const maxInput = await page.waitForSelector('input[placeholder="Max"]', { timeout: 5000 });

    // Clear and set new min and max price values
    await minInput.fill('');
    await minInput.type('50');
    await maxInput.fill('');
    await maxInput.type('500');

    // Take screenshot after entering price range
    const step2 = path.join(screenshotsDir, 'step_2_price_range_filled.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Locate and click the "Apply" button using its text
    const applyBtn = await page.waitForSelector('button:has-text("Apply")', { timeout: 5000 });
    await applyBtn.click();

    // Wait for some visible change indicating filter applied (e.g., notification or filtered products)
    // We'll wait for the notification with the price filter text
    await page.waitForSelector('div.notification.success', { timeout: 5000 });

    // Take screenshot after filter applied
    const step3 = path.join(screenshotsDir, 'step_3_price_filter_applied.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the notification text to confirm filter application
    const notification = await page.$('div.notification.success');
    let notificationText = '';
    if (notification) {
      notificationText = await notification.textContent();
    }

    // Optionally, extract the count of visible products after filtering
    let resultsCount = '';
    const countElem = await page.$('div.results-count');
    if (countElem) {
      resultsCount = await countElem.textContent();
    }

    return {
      success: true,
      action: "Applied price sort filter using the price range inputs and verified notification.",
      extractedData: {
        notificationText: notificationText ? notificationText.trim() : '',
        resultsCount: resultsCount ? resultsCount.trim() : ''
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
